  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Clarence
  Rhode National Wildlife Range outlines Refuge accomplishments during the 1968 calendar
  year. The report begins by summarizing the weather conditions and habitat conditions
  during the year. Wildlife- including migratory birds, upland game birds, furbearers,
  rodents, and mammals- is also covered. The Refuge development and maintenance section
  discusses physical developments. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  Refuge visitors and Refuge participation. Items of interest and photographs are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
